import React, { useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import ProgressLoader from '../components/ProgressLoader';
import styled from 'styled-components';

const LoadingContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
`;

const ImageCarouselPlaceholder = styled.div`
  margin-top: 20px;
  // Add styles for image carousel placeholder if needed
`;

const FinalLoading = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const vehicleDetails = location.state?.vehicleDetails || {};
  const images = location.state?.images || [];

  useEffect(() => {
    const timer = setTimeout(() => {
      navigate('/results', { state: { vehicleDetails, images } }); // Navigate to results page after 2 seconds
    }, 2000);

    return () => clearTimeout(timer); // Clear timeout if component unmounts
  }, [navigate, vehicleDetails, images]);

  return (
    <LoadingContainer>
      <ProgressLoader isLoading={true} />
      <ImageCarouselPlaceholder>
        {/* Image Carousel will be placed here */}
      </ImageCarouselPlaceholder>
      <p>Estimating Vehicle Value...</p>
    </LoadingContainer>
  );
};

export default FinalLoading;
